import {useEffect} from 'react'
import {searchOrgMount} from '../../Models/org-model'

const initialParams = {
    limit: 0,
    offset: 0
}

export function useOrgsSearch() {
    useEffect(() => {
        const data = {
            params: initialParams
        }
        searchOrgMount(data)
    }, [])
}
